import { blue } from "@mui/material/colors";
import React from "react";
// import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
const Successcard1=()=>{
    return(
        <React.Fragment>
            <div class="container">
  <div className="row">
    <div className="col-sm"><div class="card">
  <img class="card-img-top" src="https://blog.shaadi.com/wp-content/uploads/2017/05/24-may.jpg" alt="Card image cap" height="300"/>
  <div class="card-body">
    <h5 class="card-title" style={{fontFamily:'initial',fontSize:25}}>Surjeet Singh weds Diksha Kataria</h5>
    <p class="card-text" style={{fontSize:15,fontFamily:'inherit',color:'green'}}>We met at a cafe for coffee and lunch. We were both clear about our goals and expectations from life and partner. We found the comfort to be able to discuss everything at length where the date went on for 8 hours. Surjeet was traveling back to Australia soon and we managed to meet 2 more times. The compatibility was strong and we continued talking for 2 months. Meanwhile our families did their bit of background check and all went well there. With everything falling in place we decided to go ahead and get married.</p>
    {/* <a href="#" class="btn btn-primary">Go somewhere</a> */}
  </div>
</div></div>
    <div className="col-sm"><div class="card">
  <img class="card-img-top" src="https://imagecdn.jeevansathi.com/39321/4/786424085-1689101009.jpg" alt="Card image cap" height="302"/>
  <div class="card-body">
    <h5 class="card-title" style={{fontFamily:'initial',fontSize:30}}>Mohil Manchanda weds Sakshi Srivastava</h5>
    <p class="card-text" style={{fontSize:15,fontFamily:'inherit',color:'green'}}>We have met on EliteLove, started interacting with each other after sharing the numbers last year, and knowing the habits that can be matched, atlast we came to the conclusion to involve our parents so we have decided to let them meet, and see if we are ok to move further, after getting the approval from both families we met and get to know each other more deeply, and on 23rd April we got engaged, now we are preparing for our wedding.</p>
    {/* <a href="#" class="btn btn-primary">Go somewhere</a> */}
  </div>
</div></div>
    <div className="col-sm"><div class="card">
  <img class="card-img-top" src="https://imagecdn.jeevansathi.com/39321/2/786422263-1689100757.jpg" alt="Card image cap" height="230"/>
  <div class="card-body">
    <h5 class="card-title" style={{fontFamily:'initial',fontSize:30}}>Akshat Sharma weds Kshama Kaushik</h5>
    <p class="card-text" style={{fontSize:20,fontFamily:'inherit',color:'green'}}> we have talked on call and messages for approx 6 months to know each other better, by sharing our years story,</p>
    {/* <a href="#" class="btn btn-primary">Go somewhere</a> */}
  </div>
</div></div>
  </div>
</div>
        </React.Fragment>
    )
}
export default Successcard1;
